import React from 'react';
import SearchForm from '../components/SearchForm';

const Home = () => {
  return (
    <div className="home-page">
      <h1>Найдите лучшие туры для вашего отдыха</h1>
      <SearchForm />
      {/* Дополнительный контент главной страницы */}
    </div>
  );
};

export default Home;
